import Nav from "../Nav/Nav.js";
import "./Home.css";
import "../../App.css";
import me from "nat-orange.png";

const Home = () => {
    /*const myBackground = {
        backgroundColor: "#ffb457"
    }
    inline style={myBackgound}*/
    const me = "../src/images/nat-orange.png";
    console.log(me);
    return (
        <div className="homeBody" >
            <Nav />
            <img src={me} alt="me" />
            <div className="home">
                <h2>WORK IN PROGRESS</h2>
                <div className="description-box">
                    <span className="description">my name is natalie whalen, & this will be my personal website / portfolio / showcase.
                    <br/>
                    </span>
                    <br/>
                    <img src="../../images/discoBackground.jpeg" alt="none"/>
                    <br/>
                    <b>last updated: 1 August 2023</b>
                </div>
            </div>
        </div>
    )
}

export default Home;
